import { Route, Routes } from "react-router-dom";
import SecondPage from "./SecondPage";
import ProductPageCategory from "./Product page category/ProductPageCategory";
import { Categories, ProductsPage, } from '../../Data/data'
import SearchPage from "./search page/SearchPage";
// import { useState } from "react";
// import { Categoryappear } from '../redux/actions/ReduxActions'
// import { useDispatch, useSelector } from "react-redux";
// import { reducer } from "../redux/reducers/Redux";

const Mmnnnn = () => {
    const NewArray = []
    for (let i in ProductsPage) {
        for (let f in ProductsPage[i]) {
            for (let g in ProductsPage[i][f]) {
                for (let h in ProductsPage[i][f][g]) {
                    NewArray.push(ProductsPage[i][f][g][h])
                    // dispatch({ type: 'supermarket', Cat: Categories.supermarket })
                    // dispatch({ type: 'Fashion', Cat2: Categories.Fashion })
                    // dispatch({ type: 'HealthBeauty', Cat3: Categories.Fashion })
                }
            }
        }
    }
    const tempFunc = (letter) => {
        const neww = (NewArray.filter(product => product.name.toLowerCase().indexOf('ad') !== -1))
        console.log(neww)
